        <div className="tc bg-light-green dib br3 ma2 grow bw2 shadow-5">
          <img src="https://robohash.org/lena" alt="robot?200x200"/>
          <div>
              <h2>{props.name}</h2>
              <p>{props.email}</p>
          </div>
        </div>
    );
}

export default Card;
